import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props){
    super(props);
  }

  render(){
    return (
        <div>
          <p>Hello, this is APP.</p>
          <Main/>
        </div>
    );
  }
}

class Main extends React.Component {
  constructor(props){
    super(props);
  }
  render() {
    return (
        <div id={"quote-box"}>
          <p> Hello this is a quote </p>
        </div>
    );
  }
}

export default App;
